import { Component } from "react"
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faUser,faFile,faPencilAlt,faCamera,faAngleRight} from '@fortawesome/fontawesome-free-solid'



class Interstes extends Component{
    componentDidMount(){
let resume = document.getElementById("Resume");
let resumeWindow = document.getElementById("Resume-editor")

function open(prameter){
    prameter.classList.toggle("show")
}
resume.onclick =function(){ resume.addEventListener("click",open(resumeWindow))
}
    }
 
render(){



    return(   
        <div style={{justifyContent:"center",display:"flex",marginTop:"3rem"}}>
       <div className="col-sm-10 resume-container" >

       <span style={{position:"relative"}}><FontAwesomeIcon icon={faUser} /> <span id="counter">1</span></span> 
       <h5 id="Resume">Interests</h5>

       <div >
        <div style={{cursor:"text",border:"1px solid rgba(229,229,231,0.75)",padding:"1em"}} id="inter" className="Resume-editor">

            <h6>Description</h6>

        </div>
       </div>
       </div>
      </div>
      )
        
    
}
}


export default Interstes
